func TestAvlTree_Seg(t *testing.T) {
	tree := AvlTree{}
	const maxKeys = 10000
	var rank int32 = maxKeys
	for i := 0; i < maxKeys; i++ {
		tree.Add(queue.UserId(i-1), queue.UserId(i), rank)
		rank--
	}
	for i := 0; i < maxKeys; i++ {
		id := rand.Intn(maxKeys) + 1 // 范围 变为 [1,maxKeys]
		id2 := rand.Intn(maxKeys) + 1
		if id > id2 {
			id, id2 = id2, id
		}
		seg := tree.Seg(int32(id), int32(id2))
		if len(seg) != id2-id+1 {
			fmt.Printf("长度不够; want:%d;but:%d\n", id2-id+1, len(seg))
		}
		for j := 0; j < len(seg); j++ {
			want := seg[j].value.(int32)
			if seg[j].value != want {
				t.Errorf("want: %d;but :%d", want, seg[j].value)
			}
		}
	}
}
